import React, { useState } from 'react';
import { Link } from 'react-router-dom';


function Sidebar() {

    return (
        <>
            <p><Link to="/">Home</Link>
            </p>
            <p>
                <Link to="/meditation">meditation</Link>
            </p>
            <p>
                <Link to="/workout">workout</Link>
            </p>
            </>
    )

}

export default Sidebar
